tinymce.create("tinymce.plugins.Tryvary2",{init:function(t,e){t.addButton("tryvary_code_block2",{title:"Code 2",cmd:"tryvary_code_block2",icon:"code"}),t.addCommand("tryvary_code_block2",(function(){t.windowManager.open({title:"Tryvary - Insert Information 2",body:[{type:"textbox",name:"firstname",placeholder:"Enter First Name",multiline:!0,minWidth:700,minHeight:30},{type:"textbox",name:"age",placeholder:"Enter Age",multiline:!0,minWidth:700,minHeight:30},{type:"textbox",name:"code",placeholder:"Enter content",multiline:!0,minWidth:700,minHeight:150}],onsubmit:function(e){t.insertContent('[tryvary_shortcode2 name="'+e.data.firstname+'" age="'+e.data.age+'"]'+e.data.code+"[/tryvary_shortcode2]")}})}))}}),tinymce.PluginManager.add("tryvary_code_block2",tinymce.plugins.Tryvary2);